INSERT [dbo].[Novels] ([NovelId], [Title], [Image], [Author], [Type], [Description], [State], [PublishDate]) VALUES (2, N'The Novel''s Extra', , N'Ji-gab-song (지갑송)', 0, N'Waking up, Kim Hajin finds himself in a familiar world but an unfamiliar body. 
A world he created himself and a story he wrote, yet never finished. 
He had become his novel''s extra, a filler character with no importance to the story.
The only clue to escaping is to stay close to the main storyline. 
However, he soon finds out the world isn''t exactly identical to his creation.', 1, CAST(N'2023-07-21T02:40:51.477' AS DateTime))
GO
INSERT [dbo].[Novels] ([NovelId], [Title], [Image], [Author], [Type], [Description], [State], [PublishDate]) VALUES (3, N'Damn Reincarnation', , N'목마', 0, N'The warrior Hamel went on an adventure with his companions to defeat the Demon Kings, but after dying just before the final battle with the Demon Kings….
“Waaah.”
‘What the fuck!’
He was reincarnated as the descendant of his fellow warrior, Vermouth.
Hamel — no, Eugene Lionheart was reborn with the blood of the Great Vermouth.
‘My previous body held enough talent to be mistaken for a genius, but this one… there’s just no comparison.’
With a body that had higher specs right from the start, he showed explosive growth that far surpassed what he had achieved in his previous life.
Along with the unknown reasons for his reincarnation came the uneasy reality of having to coexist with demons.
He was faced with a world that made him question everything he had believed in.
Gifted with this extraordinary body since birth, as Eugene, he begins walking down the unfinished path from his previous life.', 0, CAST(N'2023-07-21T02:41:27.957' AS DateTime))
GO
INSERT [dbo].[Novels] ([NovelId], [Title], [Image], [Author], [Type], [Description], [State], [PublishDate]) VALUES (4, N'The Frozen Player Returns', , N'제리엠', 0, N'Five years after the world changed, the final boss appeared.
[The final boss for area Earth, the Frost Queen, has appeared.] The final boss! If we can just defeat her, our lives will go back to normal!
The top five players in the world, including Specter Seo Jun-ho, finally defeated the Frost Queen…
But they fell into a deep slumber.
25 years passed.
“A second floor? It didn’t end when the Frost Queen died?
Specter awakes from his slumber.', 0, CAST(N'2023-07-21T02:42:07.590' AS DateTime))
