INSERT [dbo].[Novels] ([NovelId], [Title], [Image], [Author], [Type], [Description], [State], [PublishDate]) VALUES (6, N'Etranger', , N'Yo Sam (요삼)', 0, N'Two Korean military soldiers, San and Biyeon, are participating in a joint forces exercise when their futures become intertwined through an accident, leading them down a path of struggle, pain, frustration, longing, and enlightenment.
Their adventure starts in a new world, a world where things are not always as they seem. Common sense needs to be reviewed and old ways of understanding the world no longer apply.
Only their determination and will drive them forward. What is the limit of human potential? How much can be planned and how much must be left to chance? 
They can only depend on their will to blaze a path forward…', 0, CAST(N'2023-07-21T02:43:29.207' AS DateTime))
